		assert( false, "You must pass a valid table of options with a set weaponTable property/value." )
	end
	assert( f1_arg0.Grid, "Slot displays require a gridLayout widget with an instance name of 'Grid.'" )
	local f1_local0 = 0
	local f1_local1 = ATTACHMENT.GetAttachmentData( f1_arg0, {
		weaponTable = f1_arg1.weaponTable
	} )
	local f1_local2 = ATTACHMENT.GetMaxAttachmentCount( f1_arg1.weaponTable.weapon )
	local f1_local3 = f1_local2 > ATTACHMENT.count
	local f1_local4 = nil
	if f1_arg0._sequences.DisplayExtraAttachments then
		f1_local4 = f1_arg0._sequences.DisplayExtraAttachments
	else
		local f1_local5 = f1_arg0:getParent()
		if f1_local5._sequences then
			f1_local5 = f1_arg0:getParent()
			f1_local4 = f1_local5._sequences.DisplayExtraAttachments
		end
	end
	local f1_local5 = nil
	if f1_arg0._sequences.HideExtraAttachments then
		f1_local5 = f1_arg0._sequences.HideExtraAttachments
	else
		local f1_local6 = f1_arg0:getParent()
		if f1_local6._sequences then
			f1_local6 = f1_arg0:getParent()
			f1_local5 = f1_local6._sequences.HideExtraAttachments
		end
	end
	if f1_local3 then
		if f1_local4 then
			ACTIONS.AnimateSequence( f1_arg0, "DisplayExtraAttachments" )
			ACTIONS.AnimateSequence( f1_arg0:getParent(), "DisplayExtraAttachments" )
		end
	elseif f1_local5 then
		ACTIONS.AnimateSequence( f1_arg0, "HideExtraAttachments" )
		ACTIONS.AnimateSequence( f1_arg0:getParent(), "HideExtraAttachments" )
	end
	ATTACHMENT.SortTableOnEquipped( f1_local1 )
	f1_arg0.Grid:SetRefreshChild( function ( f2_arg0, f2_arg1, f2_arg2 )
		f2_arg0._itemData = f1_arg0[f1_arg0.Grid:GetContentIndex( f2_arg1, f2_arg2 ) + 1]
		ACTIONS.AnimateSequence( f2_arg0, "Empty" )
		if not f2_arg0._itemData then
			return 
		elseif f2_arg0._itemData.ref ~= ATTACHMENT.none then
			ACTIONS.AnimateSequence( f2_arg0, "Filled" )
		end
		f2_arg0._isCurrentCategory = f2_arg0._itemData.category == f1_arg0.currentCategory
		if f2_arg0.SetSlotDisplay then
			f2_arg0:SetSlotDisplay()
		end
	end )
	if f1_arg0.EquippedText then
		if f1_local2 < #f1_local1 then
			assert( false, "There are more weapon attachments assigned to this weapon than allowed. Please check the file " .. f1_arg1.weaponTable.weapon .. " _variants.csv" )
		end
		f1_arg0.EquippedText:setText( Engine.CBBHFCGDIC( "CAS/EQUIPPED_COUNT", #f1_local1, f1_local2 ) )
		local f1_local6 = LAYOUT.GetTextWidth( f1_arg0.EquippedText )
		local f1_local7, f1_local8, f1_local9, f1_local10 = f1_arg0.EquippedText:getLocalRect()
		local f1_local11 = f1_local7 + f1_local6 + 15 * _1080p
		f1_arg0.Grid:SetLeft( f1_local11 )
		f1_local0 = f1_local0 + f1_local11
	end
	f1_local0 = f1_local0 + (f1_arg0.Grid._columnWidth + f1_arg0.Grid._spacingX) * (f1_local2 - 1)
	f1_arg0.Grid:SetNumChildren( f1_local2 )
	f1_arg0.Grid:RefreshContent()
	return f1_local0, #f1_local1
end

